import { InputNumber, ButtonUpDown } from './InputInteractiu.styles'

const InputInteractiu = (props) => 
    <div style={{backgroundColor: red}}>
    <ButtonUpDown>-</ButtonUpDown>
        <InputNumber 
            type={props.type} 
            id={props.id}
            name={props.name} 
            min={props.min}
            defaultValue={props.defaultValue} 
            onChange={props.onChangeHandler} 
            value={props.number}
        />
    <ButtonUpDown>+</ButtonUpDown>            
    </div>;


export default InputInteractiu;
